import React from 'react';
import Nav from 'react-bootstrap/Nav';
import { BsHouseDoor, BsPerson, BsBag } from 'react-icons/bs';

import './styles.scss';

const BottomNav = () => {
  return (
    <div className="bottom-nav">
      <Nav
        activeKey="/home"
        onSelect={selectedKey => alert(`selected ${selectedKey}`)}>
        <Nav.Item>
          <Nav.Link className="link" href="/homepage">
            <BsHouseDoor />
            <p className="text">Home</p>
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="link" eventKey="link-1">
            <BsPerson />
            <p className="text">Account</p>
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link className="link" eventKey="link-2">
            <BsBag />
            <p className="text">Cart</p>
          </Nav.Link>
        </Nav.Item>
      </Nav>
    </div>
  );
};

export default BottomNav;
